rss.onEnter:
startitem = "middle";
setRefreshTime(1);
storagePath = getStoragePath("tmp");
storagePath_stream = storagePath + "stream.dat";
adn_act = "false";

text.script:
idx = getQueryItemIndex();
focus = getFocusItemIndex();
if(focus==idx)
{
  adn = getItemInfo(idx, "adn");
  img = getItemInfo(idx, "img");
  image = getItemInfo(idx, "image");
}
getItemInfo(idx, "title");

fontSize.script:
		idx = getQueryItemIndex();
		focus = getFocusItemIndex();
    if(focus==idx) "14"; else "14";

backgroundColor.script:
		idx = getQueryItemIndex();
		focus = getFocusItemIndex();
    if(focus==idx) "10:80:120"; else "-1:-1:-1";

foregroundColor.script:
		idx = getQueryItemIndex();
		focus = getFocusItemIndex();
    if(focus==idx) "255:255:255"; else "140:140:140";

onUserInput.script:
ret = "false";
userInput = currentUserInput();

if (userInput == "pagedown" || userInput == "pageup")
{
  idx = Integer(getFocusItemIndex());
  if (userInput == "pagedown")
  {
    idx -= -8;
    if(idx >= itemCount)
      idx = itemCount-1;
  }
  else
  {
    idx -= 8;
    if(idx < 0)
      idx = 0;
  }

  print("new idx: "+idx);
  setFocusItemIndex(idx);
	setItemFocus(0);
  "true";
}
else if(userInput == "right" || userInput == "R")
{
showIdle();
idx = Integer(getFocusItemIndex());
url_canal = "http://127.0.0.1/cgi-bin/scripts/tv/php/prog.php?file=" + getItemInfo(idx,"id");
annotation = getURL(url_canal);
adn_act = "true";
cancelIdle();
redrawDisplay();
ret = "true";
}
else
{
annotation = " ";
adn_act = "false";
ret = "false";
}
redrawDisplay();
ret;

